    "Population, distribution and ecology of Aleutian Canada geese on their migration
    and wintering areas, 1980-1981",nt"tracking_summary": {ntt"total": 3,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:02:20.488568",nt"name": "population-distribution-and-ecology-of-aleutian-canada-geese-on-their-migration-and-w-1980",nt"isopen":
    false,nt"url": null,nt"notes": "The migration and wintering ground study
    of the Aleutian Canada goose (Branta canadensis leucopareia) was continued again
    in California in 1980-81 from October 10 May 7. Primary attention was directed to
    the major use areas near Crescent City, Colusa, and Modesto, but surveys were also
    conducted in the Los Banos and Sacramento-San Joaquin Delta areas. A combined fall
    estimate of 1970 in the Colusa and Crescent City areas and a spring estimate of
    1940 in the Crescent City area were the highest ever recorded. A total of 200 marked
    individuals were observed 3916 times. Among these were 1 captive-reared bird from
    the release on Agattu Island in the western Aleutians in 1979, 28 captive-reared
    birds (including 19 young) from the release in 1980, 2 wild young transplanted from
    Buldir Island to Agattu in 1979, and 44 wild birds (including 36 young) transplanted
    in 1980. The combined sighting-recovery rate of birds used in the 1980 program was
    73 percent for transplanted birds but only 15 percent for released birds. A total
    mortality of 35 known and 8 possible Aleutians, including 13 shot illegally, is
    somewhat higher than in previous years. The present closure zones were effective
    in protecting the Aleutian Canada goose population. Eighty-three birds were banded
    in the spring near Crescent City.",nt"license_title": "License Not Specified",nt"extras":
